INSERT INTO `field_data_field_last_name` VALUES ('node','faculty_profile','0','1252','1252','und','0','Walley','filtered_html'),('node','faculty_profile','0','1253','1253','und','0','Shanks','filtered_html'),('node','faculty_profile','0','1254','1254','und','0','Kimball','filtered_html'),('node','faculty_profile','0','1255','1255','und','0','Vallega','filtered_html'),('node','faculty_profile','0','1256','1256','und','0','Biersack','filtered_html'),('node','faculty_profile','0','1257','1257','und','0','Dracobly','filtered_html'),('node','faculty_profile','0','1258','1258','und','0','Mathas','filtered_html'),('node','faculty_profile','0','1259','1259','und','0','Murphy','filtered_html'),('node','faculty_profile','0','1260','1260','und','0','Bonds','filtered_html'),('node','faculty_profile','0','1261','1261','und','0','Albert-Galtier','filtered_html'),('node','faculty_profile','0','1262','1262','und','0','Burlando','filtered_html'),('node','faculty_profile','0','1263','1263','und','0','Freedman','filtered_html'),('node','faculty_profile','0','1264','1264','und','0','Gash','filtered_html');
INSERT INTO `field_data_field_short_bio` VALUES ('node','faculty_profile','0','1252','1252','und','0','Professor Walley received her Ph.D. from Harvard University in 2009. She specializes in Japanese Buddhist art and archaeology from the 7th and 8th centuries and is currently working on a book manuscript on the bronze Shaka triad in the Golden Hall of Horyuji (Nara, Japan).',null,'filtered_html'),('node','faculty_profile','0','1253','1253','und','0','I have broad research interests (biological oceanography, animal behavior, intertidal ecology, larval biology). If I had to point to a general theme to my research I think that it is my fascination with the interaction of the physical realm and the biological. Much of my work seems to be at the interface between physical and biology oceanography. For example, much of my present research effort is directed at understanding how the dispersal of larval invertebrates and fish is affected by currents and the behavioral of larvae. There is probably a second theme that runs through my work; I am strongly driven by my curiosity. Early in my career, I discovered that if I was observant and followed my curiosity, I could make novel discoveries. Through out my career, I have tried to pay attention to my observations and serendipity and to actively follow these leads. A number of papers have come from this effort. When training students (undergraduate or graduate), one of my primary goals is to persuade them to follow their curiosity as this leads to novel and creative discovers (and besides it is fun).',null,'filtered_html'),('node','faculty_profile','0','1255','1255','und','0','Professor Vallega works on the fields of Latin American philosophy/thought, decolonial thought, Continental philosophy (phenomenology, hermeneutics, and deconstruction), and aesthetics. He has also done extensive work on the history of Western philosophy and Ancient Greek philosophy. Some of his most pressing concerns are the decolonizing of world philosophies, the relationship of Latin American thought and Continental philosophy, the aesthetic elements at work in conceptual thought, the pre-linguistic experiences that underlie conceptual knowledge, the way literature, oral traditions, and graphic arts occur as thought, the reinterpretation of word and image as ciphers for the articulation of human existence in its distinctness and fecundity of meanings, and the ways loss, silence, involuntary memory, and nonrepresentational modalities of understanding are at play in the movement and determinations of philosophical thought. The aim of his research is the decolonizing of the imaginaries that situate and orient the projection and configuration of conceptual knowledge. This through the engagement of the aesthetic experiences that underlie rational understanding. In a broader sense his work seeks to enrich in a transformative and critical way the understanding of philosophy and humanism (in their limits and possibilities) in light of previously excluded ways of being-in-the_world. In his work profesor Vallega interpolates Latin American thought and experience with Western thought, he seeks the development of Souhth-South dialogues, and he rethinks out of the concrete excluded knowledges and ways of being such concepts as experience, knowledge, beauty, language, history, nature, the human, agency, time, and space.  ',null,'filtered_html');
INSERT INTO `field_data_field_short_bio` VALUES ('node','faculty_profile','0','1257','1257','und','0','Dracobly has been working on a history of French venereology, 1820-1870, for the last decade. He is currently in his sixteenth year of teaching at the University of Oregon, where he mostly teaches courses on military history, both in Europe and around the globe. He is also the founding director of the UO Veterans Oral History Project, an on-going effort to document and archive the experiences of student veterans of the Iraq and Afghanistan Wars at the University of Oregon.',null,'filtered_html'),('node','faculty_profile','0','1258','1258','und','0','Math_s is working on a book that focuses on how German writers from different periods since 1750 have engaged with scientific and philosophical ideas about what defines a human being. The interest in defining the human coincides with a flowering of German literature and the rediscovery of humanism at the end of the 18th century. Like the original humanism of the Renaissance, German neo-humanism is associated with the rediscovery of Greek aesthetics and the emancipation of the individual. Writers were consciously paying tribute to Greek culture and its artifacts as harmonious manifestations of a well-rounded human being. In their view, the call for the emancipation of the individual had been answered in the distant past, and the art that it produced became a witness in the struggle for the liberation of the bourgeois citizen. Although this type of humanism has often been portrayed as a form of art that is above and beyond politics, it has had far-reaching political implications. By analyzing exemplary literary and theoretical texts from different periods and authors, the study shows that humanist ideas were far from timeless. It examines how these ideas were used to promote period-specific aesthetic, philosophical, and ideological agendas.',null,'filtered_html'),('node','faculty_profile','0','1259','1259','und','0','Murphy specializes in the political and cultural geography of Europe and the Middle East. His research focuses on three themes: (1) the ways in which the political organization of territory reflects and shapes patterns of ethno-national identity, (2) the changing political-territorial order in Europe in the wake of integration, and (3) the geographical assumptions that undergird different geopolitical ideas about the Middle East.\n\nHe has studied such issues as the impact of the partitioning of Belgium along language lines on senses of Flemish and Walloon identity, the ways in which transboundary cooperation agreements in Europe influence perceptions of cultural continuity and difference, and the ways in which particular political geographic ideas and assumptions shape decisions in the international arena (e.g., the decision in Europe to adopt a common currency or the decision in the United States to intervene militarily in Iraq). He has also written widely on the nature of geography as a discipline and the insights that geographical perspectives can offer in the effort to confront contemporary political, social, and environmental challenges.',null,'filtered_html');
INSERT INTO `field_data_field_short_bio` VALUES ('node','faculty_profile','0','1260','1260','und','0','In 1990-1991, Bonds received a Fulbright appointment to teach costume design at the National Institute for the Arts, now the Taipei National University of the Arts in Taiwan. During this year, the school celebrated its move from Luchow to a new campus in Guandu, and she designed eight super-puppets for this celebration based on Taoist rituals. During festivities lasting for six months, the students and faculty created performances based on the history of the institute, partook in the commemoration of the birthday of Matsu, goddess of the sea, and culminated the year with a two-day parade and pilgrimage from the old campus to the new.\n\nThe year in Taiwan inspired her research interests in Chinese performance and influenced her book entitled, Beijing Opera Costumes: The Visual Communication of Character and Culture, which was recently published by the University of Hawaii Press. Research for the book was conducted in Taipei, Beijing, and Honolulu, Hawaii. The book is the first English-language in-depth analysis of the theory and practice of dress in this traditional performance style. Bonds has lectured nationally and internationally on this subject, and her research efforts have twice been recognized with awards for excellence in writing for the performing arts.',null,'filtered_html'),('node','faculty_profile','0','1262','1262','und','0','Burlando current research focuses on the interaction between formal financial markets and informal risk sharing networks in East Africa, with ongoing projects on mobile money in Tanzania and savings groups in Uganda. His past work includes an examination of the impact of infrastructure development on health and fertility in Tanzania. He also works on theories that explore the implications of drug legalization on police corruption.',null,'filtered_html');
